import React from "react";


class User extends React.Component{
    constructor(props){
        super(props);
    }

    render(){

        const greeting = () => {alert(this.props.name)}
        
        return(
            <div>
                <button onClick={greeting}>인사</button>
            </div>
        );
    }
}

export default User;
